% Sigmoid:
Vars.sequential_4_dens_9 = sigmoid(Vars.sequential_4_dens_6);
NumDims.sequential_4_dens_9 = NumDims.sequential_4_dens_6;

% MatMul:
[Vars.sequential_4_dens_13, NumDims.sequential_4_dens_13] = onnxMatMul(Vars.sequential_4_dens_9, Vars.sequential_4_dens_12, NumDims.sequential_4_dens_9, NumDims.sequential_4_dens_12);

